import './App.css';
import NavBar from './components/NavBar/NavBar';
import Hero from './components/Hero/Hero';
import Stats from './components/Stats/Stats';
import Profile from './components/Profile/Profile';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <NavBar />
      <Hero />
      <Stats />
      </header>
    </div>
  );
}

export default App;
